import React from 'react';
import 'semantic-ui-css/semantic.min.css';
import './components.css';
import {store} from '../store';
import RightSearchResults from './rightSearchResults';
import RightVideoPlayer from './rightVideoPlayer';
import RightWelcome from './rightWelcome';


export default class rightPanel extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      user: this.props.user,
      isDataLoaded: 0,
    }
  }

    render(){
      console.log("Rendering right panel with isDataLoaded: "+this.state.isDataLoaded);
      
      var rightPanel = null;

      var rightState = store.getState().ShowRightPanel;

      if(rightState.rightShowWelcome === 1)
        rightPanel = <RightWelcome />;

      if(rightState.rightSearchResults === 1) {
        rightPanel = <RightSearchResults />;
      }

      if(rightState.rightVideoPlayer === 1) {
        rightPanel = <RightVideoPlayer />;
      }

      if(rightPanel === null)
        console.error("Error when logging right panel : undefined state in state.ShowRightPanel");

      
       return (


          {rightPanel}


        );
      
    }

};
